package ManishLokesh.Neptune.v1.PNRService.PnrResponse;public class SeatResponse {    private String coach;    private String berth;    @Override    public String toString() {        return "SeatResponse{" +                "coach='" + coach + '\'' +                ", berth='" + berth + '\'' +                '}';    }    public String getCoach() {        return coach;    }    public void setCoach(String coach) {        this.coach = coach;    }    public String getBerth() {        return berth;    }    public void setBerth(String berth) {        this.berth = berth;    }}